import "./City.css";

const City = ({ data }) =>
{
  const cityCounts = {}

  data.forEach((item) =>
  {
    const city = item.city;
    if (cityCounts[city])
    {
      cityCounts[city]++;
    } else
    {
      cityCounts[city] = 1;
    }
  });

  console.log(cityCounts)
  return (
    <div className="city">
      {data.map((item, index) =>
      {
        return (
          <div
            key={index}
            className="card-city"
            style={{ backgroundImage: `url(${item.image})` }}
          >
            <h3>{item.subText}</h3>
            <h2>{item.name}</h2>
          </div>
        );
      })}
    </div>
  );
};
export default City;
